import React from 'react'
import {Form,Label,Input,FormGroup} from 'reactstrap'
function Register() {
  return (
    <div>
<Form>
  <FormGroup>
    <Label for='name'>User Name</Label>
    <Input/>
  </FormGroup>
</Form>
    </div>
  );
}

export default Register
